import React from 'react';
import './photo.css';
import goBackArrow from '../../assets/goBackArrow.svg';


const Photo = ({state, background}) => {
    return (
        <div className='image' style={{backgroundImage: `url(${background})`}}> 
            <div className='image_container-arrow' >    
                <a href='/projects'><img className='image-container-arrow' src={goBackArrow}/></a>
                {state === 'CLOSED' ? (
                    <div clstyle={{background: '#FF0000'}}>
                    <p>{state}</p>
                    </div>
                ): state === 'RESOURCING' ? (
                    <div style={{background: '#EC7F00'}}>
                    <p>{state}</p>
                    </div>

                ): state === 'PROGRESS' ? (
                    <div style={{background: '#04B500'}}>
                    <p>{state}</p>
                    </div>
                ):(
                    <div>
                    <p>UNKNOWN</p>
                    </div>
                )}
            </div>
        </div>
    )
}

export default Photo
